  args: {
    schema: {
      title: 'Validation Test',
      type: 'object',
      required: ['name'],
      properties: {
        name: {
          type: 'string',
          title: 'Name'
        },
        email: {
          type: 'string',
          format: 'email',
          title: 'Email'
        }
      }
    },
    uiSchema: {},
    formData: {
      name: '',
      email: ''
    }
  },
  render: args => <JsonSchemaForm {...args} schema={args.schema} onSubmit={handleSubmit} onError={handleError} onChange={val => action('onChange')(val)} />,
  play: async ({
    canvasElement
  }) => {
    const canvas = within(canvasElement);
    const nameInput = await canvas.findByRole('textbox', {
      name: /name/i
    });
    const emailInput = await canvas.findByRole('textbox', {
      name: /email/i
    });
    const submitButton = await canvas.findByRole('button', {
      name: /submit/i
    });
    await userEvent.clear(nameInput);
    await userEvent.type(emailInput, 'lee(at)example.com');
    await userEvent.click(submitButton);
    await new Promise(r => setTimeout(r, 100)); // allow validation to propagate

    const errors = await canvas.findAllByText(/must match format "email"/i);
    expect(errors.length).toBeGreaterThan(0);
    expect(handleError).toHaveBeenCalled();
    expect(handleSubmit).not.toHaveBeenCalled();
  }
